      &lt;pre&gt;\nimport h5py\nimport os\nimport dask.array as da\nimport dask\nfrom dask.distributed import performance_report, Client\nimport json \nfrom dask_ml.decomposition import InSituIncrementalPCA\nimport time \nimport yaml\n\n#Scheduler file name and configuration file\nscheduler_info = 'scheduler.json'\nconfig_file = 'config.yml'\n\ndef connect(sched_file):\n    with open(sched_file) as f:\n        s = json.load(f)\n    adr = s[\"address\"]\n    try:\n        client  = Client(adr) #, timeout=60, heartbeat_interval=10)\n        print(\"client connected\", flush=True)\n    except Exception as e:\n        print(\"retrying ...\", flush=True)\n        client = Client(adr) #, timeout=60, heartbeat_interval=10)\n    return client\n\n\n# Get client\nclient = connect(scheduler_info)\ndask.config.set({\"distributed.deploy.lost-worker-timeout\": 60, \"distributed.workers.memory.spill\":0.97, \"distributed.workers.memory.target\":0.95, \"distributed.workers.memory.terminate\":0.99 })\n\nwith open(config_file) as file:\n    data = yaml.load(file, Loader=yaml.FullLoader)\n    chun= data[\"chunks\"]\n\nchuny=int(chun[\"width\"])\nchunx=int(chun[\"height\"])\nprint(\"chunks\", chunx, chuny)\n\n\n\nwith performance_report(filename=\"dask-report.html\"): \n    t = time.time()\n    f = h5py.File('data.h5', 'r') \n    d = f['local_t']\n    print(d, flush=True)\n    gt = da.from_array(d, chunks=(1,chunx,chuny))\n    \n    pca=InSituIncrementalPCA(n_components=2,copy=False, svd_solver='randomized')\n    print(\"pca, \", pca, flush=True)\n\n    l = pca.fit(gt, [\"t\", \"X\", \"Y\"], [\"X\"], [\"Y\"])\n    #print(\"this is l :\", l, flush=True)\n\n    cpt = [pca.explained_variance_ ,   pca.singular_values_ ]\n    # Submit the task graph to the scheduler\n\n    explained_variance , singular_values = client.persist(cpt)\n    #arrays.validate_contract()   \n    explained_variance , singular_values = client.compute([explained_variance ,singular_values])\n    print(\"explained_variance ,singular_values\",explained_variance.result() ,\" and \" , singular_values.result(), flush=True )\n\nprint(\"Done in \", time.time() -t , \" secondes\")\n    \nos.remove('data.h5') \nclient.shutdown()\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{},"id":"1455","type":"AllLabels"},{"attributes":{},"id":"1321","type":"Selection"},{"attributes":{},"id":"1442","type":"AllLabels"},{"attributes":{"child":{"id":"bk-bandwidth-type-plot"},"title":"Bandwidth (Types)"},"id":"1408","type":"Panel"},{"attributes":{"data":{"bandwidth":{"__ndarray__":"64kB/l36z0HYLx7cc7OMQaW6dV/iaINBH7cakPBklEGflrao3mCGQfukAjax2p5BK9lrFgqJtUFnKXPkdQS0QYPKxzUJYLZBnwnzJPV6tkE1xjmQyp6fQSEnI55L16lB8y4sG+F0wUGE6/pPCkTOQZAZW+GTWsNBeMr/iZ6gx0EHlS1jkyrJQRH6okNKzshB1XOZZnsTs0GqlUQY7oOYQeUfYV18b7ZBZUc1G1uxtUGv6CEetk2tQaZWb5gMishBdhcyo3oixkHE3xX+XpxzQYmRz1QAumVBCl7I8wqTsEH/FsloqCivQe+8eDTO86tBcqiZF5+drEENV/2wGG+3Qa8hULwiBrRBy1RVB7sNskFkVkUBBD7MQciJ8tbZWIRBUPGnSAFurkFZBWhUAaGbQciQP01k3JhBgztNYM6ohEGY9xkQIc+LQUOLADEj0HxBQUSjWlSRjEG7IKkgzki2QTgMuTYTrZ5BywWtvlkmnkFYHfUSEgSYQRbZ8xEzwaxB2O3bRS4HYEEAnXt/6We3QbnmUJWxHLZBPnLeq5IvrEHJm/996re0QaZmSdKibjlBg9UF/avNsEGk3Lr4HUKxQRKJGarH7KpBCyCM/aW9qUH6nT4fLxWsQUCEnD7GoKtBESsS70U0q0FpRmw/RJqnQVbulzuTk8pByYEaeUKTykGZ1R4NGKJpQcsQBLqmB7VBnzBFsH2UrkF9FonGOF6qQaeKz9uAXalBxfgHk3j4mUG4TIIElji+QeNrfVhXFrpBmszrsSs4o0HxEQe2RbGlQUn3yFWCJaRBT5IDsWUfo0H95AblqDqiQelzmAvfYKFBGdG7gsUEqUFjdGFrSgEmQTZxeh+CGKdB6bplisFxpkEqug/avvqkQQLYA+zDyLVBEcTRLFjJqUFdi63qBkKnQfURdVqGBalBnD8jigc6pkG0iKNF3WimQTcYjGgWuaVBr2sny0WDu0FBj7cgvEi2Qe55PN/B67BBXLEnG+B8qUHY04CPoU2nQRjKsJshk3FBiFxzW0gqskFfhkAAm9WsQa4FccDnaKpBI6TitlwKq0FP6aFWsESpQUsFfD6qwrNB3Tnmaq1WskGXfoU4WniwQY5QE6HKZq1B+xRxDwJlq0FDJ10TpdatQYLokDphDatBAttfauLJrkE/3D9H8hioQSwf3T1JAaRBiKUKzd/8okEXNrTrV++wQW0myWN7i6hBx32Hpk/apUGhrmhzCcuWQWgDW5lnv5RBrnHcfFD8j0G6ZDAtAa2/QXnMDJ/8E2NBSNKUCjJjt0HRfq2aJE+sQc4LcgMFsatBShsaI1mhwEFnL9CfUnK5QfXu3lmd9alBwNuGs79Bp0FuFnZAPKG0QSQMFbMHWrFBAGwtwLwBsEF8G3EGeiG9QcG5yeXy6sBBAQnjJBizuEHkpx
